(1, '<p><span style=\"color: rgb(110, 107, 123);\">Anda dapat mengajukan pertanyaan, meminta bantuan, memberikan saran, dan komplain transaksi kepada CS kami setiap hari pada jam kerja. Kami akan berusaha dengan segera menjawab pertanyaan dari Anda di jam kerja. Pertanyaan diluar jam kerja tetap akan dijawab di jam kerja. Berikut jam kerja CS </span><strong style=\"color: rgb(110, 107, 123);\">AppKu</strong><span style=\"color: rgb(110, 107, 123);\">:</span></p><ul><li>Senin - Minggu: 09.00 - 03.00 WIB</li><li>Istirahat I : 12.00 - 13:00 WIB</li><li>Istirahat II : 22.00 - 23:00 WIB</li></ul><p><br></p><p><span style=\"color: rgb(110, 107, 123);\">﻿</span><strong style=\"color: rgb(110, 107, 123); background-color: var(--bs-card-bg);\">Berikut kontak yang dapat Anda hubungi jika ada kendala:</strong></p><ul><li>WhatsApp:&nbsp;0857-5972-8755&nbsp;<em>(fast respon)</em></li><li>Email: support@appku.com&nbsp;<em>(slow respon)</em></li></ul><p><br></p><p><strong><em>﻿Terimakasih.</em></strong></p>');
